    }

    .landing__header-no-reg-content{
        display: none;
    }
}

.main{

    .landing-page__search-form{
        display: none;
        position: absolute;
        top: 20%;
        left: 140px; 
    }

    .landing-page__reg-form{
        display: none;
        position: absolute;
        top: 20%;
        left: 140px; 
        z-index: 0;
    }

    .landing-page__enter-form{
        position: absolute;
        top: 20%;
        left: 140px; 
        z-index: 0;
    }
}

.landing-page-footer-underline{
    margin-top: 1px;
}

* {
    font-family: Montserrat;
}

.main-image{
    //overflow: hidden;
    width: 100%;
    top: 0px;
    position: fixed;
    z-index: -1000;
}

.filler{
    background-image: url("../ui_kit/images/FoneImage.svg");
    background-size: cover;
    width: 100%;
    padding-bottom: 56%;
}

